import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Summary from './components/Summary';
import Reports from './components/Reports';
import Navbar from './components/Navbar';
import { getToken } from './utils/auth';

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={getToken() ? <Navigate to="/dashboard" /> : <Login />} />
        <Route path="/dashboard" element={getToken() ? <Dashboard /> : <Navigate to="/" />} />
        <Route path="/summary" element={getToken() ? <Summary /> : <Navigate to="/" />} />
        <Route path="/reports" element={getToken() ? <Reports /> : <Navigate to="/" />} />
      </Routes>
    </Router>
  );
};

export default App;
